import React from 'react';
import Post from './Post/Post';

const posts = (props)=>(
    <div className="box">
       
            {props.postsData.map(ctrl=>(
                <Post 
                    key={ctrl.username} 
                    name={ctrl.username}
                    image={ctrl.image}/>
            ))}
            
   
        <style jsx>
        {`
            div{
                width: 100%;
                display: flex;
                flex-flow: column;
                align-items: center;
                box-shadow: 0 2px 1px #ccc;
                margin: auto;
                padding: 10px 0;
            }
        
        `}    
        </style>
    </div>
);



export default posts;
